    <div className="tab__content__filmShow">
      <CinemaSysHomeRightItem />
      <CinemaSysHomeRightItem />
      <CinemaSysHomeRightItem />
      <CinemaSysHomeRightItem />
      <CinemaSysHomeRightItem />
    </div>
  );
}

export default CinemaSysHomeRight;
